import menu_1 from './menu_1.png'
import menu_2 from './menu_2.png'

export const assets = {
    logo,
    search_icon,
    basket_icon,
    header_img,
}

export const menu_list = [
    {
        menu_name: "Salads",
        menu_image: menu_1
